goods specification:
Изделия ручной работы художественно-декоративного и утилитарно-бытового назначения, изготовленные по технологии художественной обработки кости и рога, включая бивень мамонта, кости и рог домашних и диких животных, зуба кашалота с объемной, рельефной и ажурной резьбой, токарной обработкой, с гравировкой, полировкой и инкрустацией, в оклейной технике, а также в сочетании с металлом, деревом и другими материалами: 
сувениры - объёмно-фигурные отдельные миниатюры и многофигурные скульптурные композиции; 
вазы, шкатулки, коробочки, игольницы, напёрстки, вязальные крючки, подсвечники, ручки писчие декоративные, стаканы-карандаши, писчие настольные приборы, ножи листорезы, визитницы, подставки под флеш-карту, памятные медали, художественные экраны и панно, брелоки, шахматы, шашки, курительные трубки, ножи сувенирные; 
предметы церковно-культового назначения - иконы, иконки, кресты, образки, ладанки; 
ювелирные изделия - кольца, серьги, броши, кулоны, заколки, медальоны, бусы, подвески, колье, браслеты.

